// BubbleMap/index.js
import React from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';

// Coordinates for Braunschweig, Germany
const position = [52.2665, 10.5268];

const BubbleMap = ({ data }) => {
    const markerIcon = new L.Icon({
        iconUrl: require('leaflet/dist/images/marker-icon.png'), // Leaflet default marker
        iconSize: [25, 41],
        iconAnchor: [12, 41],
        popupAnchor: [1, -34],
        shadowSize: [41, 41],
    });

    return (
        <MapContainer center={position} zoom={12} style={{ height: '400px', width: '100%' }}>
            <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            {data.map((d, index) => {
                const [longitude, latitude] = d.coords; // Assuming coords are structured [longitude, latitude]
                return (
                    <Marker key={index} position={[latitude, longitude]} icon={markerIcon}>
                        <Popup>
                            HRV: {d.HRV}<br />
                            Timestamp: {d.Timestamp.toISOString()} {/* Adjust this as needed */}
                        </Popup>
                    </Marker>
                );
            })}
        </MapContainer>
    );
};

export default BubbleMap;
